import { Button, Card } from "@material-ui/core";

import Books from "./Books";

// npm add @material-ui/core

function App() {
  return (
    <div className="App">
      <Books/>
      <Card>Nur ein kleiner test!</Card>
      <Button variant="contained">Hello World!</Button>
    </div>
  );
}

export default App;
